class install
{

    private $errors = array();

    public function step1($post)
    {
        $count = 0;
        if (!isset($post['code']) or !$this->valid($post['code'])) {
            $this->errors['code'] = "Invalid code ";
            $count++;
        }
        if (!isset($post['firstusername']) or !$this->valid($post['firstusername'])) {
            $this->errors['username1'] = "Invalid username ";
            $count++;
        }
        if (!isset($post['firstpassword']) or !$this->valid($post['firstpassword'])) {
            $this->errors['password1'] = "Invalid password ";
            $count++;
        }
        if ($count == 0) {
            $code = $post['code'];
            $username = $post['firstusername'];
            $pass = md5($post['firstpassword']);
            $ch = curl_init();
            curl_setopt($ch, CURLOPT_URL, "http://localhost/brighterycms/en/management/api?code=$code&username=$username&password=$pass");
//            curl_setopt($ch, CURLOPT_g 1);
//            curl_setopt($ch, CURLOPT_POSTFIELDS, "");
            curl_setopt($ch, CURLOPT_RETURNTRANSFER, true);
            $server_output = curl_exec($ch);
            curl_close($ch);
//            echo $server_output;
            $array = json_decode($server_output);
            if ($array->status == 'faild') {
                return json_encode($array);
            }
            if ($array->status == 'success') {
//
////                $handle = fopen("..\License\license.inc", "w");
////                fwrite($handle,$array->code );
                return json_encode(array('status' => 'success'));
            }
        }


        if ($count != 0)
            return json_encode(array('errors' => $this->errors));
    }

    public function step2($post)
    {
        $coun = 0;
        if (!isset($post['host']) or !$this->valid($post['host'])) {
            $this->errors['host'] = "Invalid host ";
            $coun++;
        }
        if (!isset($post['username']) or !$this->valid($post['username'])) {
            $this->errors['username'] = "Invalid username";
            $coun++;
        }
        if (!isset($post['database']) or !$this->valid($post['database'])) {
            $this->errors['database'] = "Invalid database";
            $coun++;
        }
        if ($coun == 0) {
            $this->validate_connection($post['database'], $post['host'], $post['username'], $post['Password'], 'connection one');
        }
        if (!empty(isset($post['check']))) {
            $count = 0;
            if (!isset($post['another_host']) or !$this->valid($post['another_host'])) {
                $this->errors['another_host'] = "Alternative host is invalid ";
                $count++;
            }
            if (!isset($post['another_username']) or !$this->valid($post['another_username'])) {
                $this->errors['another_username'] = "Alternative username Invalid ";
                $count++;
            }
            if (!isset($post['another_database']) or !$this->valid($post['another_database'])) {
                $this->errors['another_database'] = "Alternative database Invalid ";
                $count++;
            }
            if ($count == 0) {
                $this->validate_connection($post['another_database'], $post['another_host'], $post['another_username'], $post['another_password'], 'Alternative connection ');
            }
        }
        return json_encode(array('errors' => $this->errors));
    }

    public function step3($post)
    {
        $count = 0;
        if (!isset($post['fullname']) or !$this->valid($post['fullname'])) {
            $this->errors['fullname'] = "fullname required";
            $count++;
        }
        $repass = "/(?=.*[a-z])(?=.*[A-Z])(?=.*[0-9])(?=.{8,})/";
        if (!isset($post['pass']) or !$this->valid($post['pass']) or !preg_match($repass, $post['pass'])) {
            $this->errors['pass'] = "Your password must contain at least 1 uppercase, 1 lowercase, 1 number and 8 characters of length at least.";
            $count++;
        }
        if (!isset($post['email']) or !$this->valid($post['email']) or !filter_var($post['email'], FILTER_VALIDATE_EMAIL)) {
            $this->errors['email'] = "invalid email";
            $count++;
        }
        return json_encode(array('errors' => $this->errors));
    }

    public function step4($post)
    {

        $dsn = 'mysql:dbname=' . $post['database'] . ';host=' . $post['host'] . '';
        $user = $post['username'];
//        $password = $post['password'];
        $password = '';
        try {
            $dbh = new PDO($dsn, $user, $password);
            $sql = file_get_contents('Database.sql');
            $qr = $dbh->exec($sql);
            $sql1 = "INSERT INTO users (fullname,password,email,usergroup_id,status) VALUES (:fullname,:pass,:email,:usergroup_id,:status)";
            $q = $dbh->prepare($sql1);
            $q->execute(array(':fullname' => $post['fullname'],
                ':pass' => md5($post['pass']),
                ':email' => $post['email'],
                ':usergroup_id' => 1,
                'status' => 'active'));
            echo $sql1;

        } catch (PDOException $e) {
            $this->errors['query'] = "query not execute" . $e->getMessage();
        }
    }

    public function valid($val)
    {
        return !empty(strip_tags($val));
    }

    public function validate_connection($database, $host, $username, $pass = null, $msg)
    {

        $dsn = 'mysql:dbname=' . $database . ';host=' . $host . '';
        $user = $username;
        $password = $pass;
        try {
            $dbh = new PDO($dsn, $user, $password);
        } catch (PDOException $e) {
            $this->errors[$msg] = "connection failed";
            return json_encode(array('errors' => $this->errors));
        }
    }

}

if (isset($_GET['step']))
    exit();
